import React from "react";
import { useNavigate } from "react-router-dom";
import "./LandingPage.css";

const LandingPage = () => {
  const navigate = useNavigate();

  const handleLogin = () => {
    navigate("/app");
  };

  return (
    <div className="landing-container">
      <nav className="navbar">
        <h1 className="logo">Canvas of Care</h1>
        <div className="nav-links">
          <a href="#about">ABOUT</a>
          <a href="#gallery">GALLERY</a>
          <a href="#resources">RESOURCES</a>
          <a href="#policies">POLICIES</a>
        </div>
        <button className="enter-btn" onClick={handleLogin}>ENTER ART STUDIO</button>
      </nav>

      <div className="hero-section">
        <div className="hero-text">
          <h3>CREATIVE REFUGE</h3>
          <h1>Unleash Your Artistic Spirit.</h1>
          <p>
            Experience a nurturing environment where creativity flourishes amidst
            the challenges of cancer. Use our intuitive platform to engage in
            meaningful self-expression, showcase your creations, and connect
            with others on similar journeys.
          </p>
          <button className="join-btn">JOIN US</button>
        </div>

        <div className="login-box">
          <input type="email" placeholder="Email Address" />
          <input type="password" placeholder="Password" />
          <div className="login-links">
            <a href="#forgot-password">Forgot Password?</a>
            <a href="#sign-up">Sign Up</a>
          </div>
          <button className="login-btn" onClick={handleLogin}>LOGIN</button>
        </div>
      </div>
    </div>
  );
};

export default LandingPage;
